import axios from "axios";

const photoUrl = "https://jsonplaceholder.typicode.com/photos";
const usersUrl = "https://jsonplaceholder.typicode.com/users";
const albumUrl = "https://jsonplaceholder.typicode.com/albums";

const fetchData = () => (dispatch) => {
  return axios
    .get(photoUrl)
    .then((resp) => {
      dispatch({
        type: "SET_PHOTO",
        payload: resp.data,
      });

      axios
        .get(usersUrl)
        .then((resp) => {
          dispatch({
            type: "SET_USERS",
            payload: resp.data,
          });

          axios
            .get(albumUrl)
            .then((resp) => {
              dispatch({
                type: "SET_ALBUM",
                payload: resp.data,
              });
            })
            .catch((err) => {
              dispatch({
                type: "SET_ERROR_MESSAGE",
                message: "error.unable_to_process",
              });
            });
        })
        .catch((err) => {
          dispatch({
            type: "SET_ERROR_MESSAGE",
            message: "error.unable_to_process",
          });
        });
    })
    .catch((err) => {
      dispatch({
        type: "SET_ERROR_MESSAGE",
        message: "error.unable_to_process",
      });
    });
};

const setThumbnail = (data) => (dispatch) => {
  return dispatch({
    type: "SET_THUMBNAIL",
    payload: data,
  });
};

export { fetchData, setThumbnail };
